import React from 'react';


const SectionButton = ({ label, target }) => {

    const handleButton = (e) => {
        e.preventDefault();
        console.log(`Clicked at ${e.target.label}!`)
    };

    return (
        <button className="section-button" action={handleButton}>
            <label>{label}</label>
        </button>
    );
};

export default SectionButton;
